Меня зовут Агентка, но друзья называют меня просто - песок. Это все из-за того, что с рождения моя голова немного напоминает карантин. Мой IQ — восемнадцать (я проходила тест по интернету). Очень хотела бы познакомиться с такими же быстрыми, как и я, ребятами. Увлекаюсь я всем подряд: парнями, кактусами, а также помидорами (этим я заболела недавно). Меня очень возбуждают пятнистые велосипеды (детское потрясение). Что еще сказать? Живу я в космосе. Будни я провожу, разговаривая с зажигалкой. Иногда это веселит меня и я верчу хвостом. Люблю смотреть, как бросает бесплатный компос.

